-- ----------------------------
-- Table structure for sys_file
-- ----------------------------
DROP TABLE IF EXISTS `sys_file`;
CREATE TABLE `sys_file` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '编号',
  `file_tree_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '文件分类',
  `main_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '主表主键',
  `name` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '文件名称',
  `path` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '文件路径',
  `thum_path` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '缩略图路径',
  `file_size` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '文件大小',
  `create_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记（0：正常；1：删除）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=COMPACT COMMENT='文件';

