  KEY `test_tree_del_flag` (`del_flag`) USING BTREE,
  KEY `test_data_parent_id` (`parent_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=COMPACT COMMENT='树结构表';

